const e="Language",n="Volumes",a="Series",t="Publishers",i="Contributors",r={language:e,"language.de":"German","language.en":"English","language.jpn":"Japanese","menu.home":"Home","menu.stats":"Statistics","menu.portfolio":"Portfolio","menu.projects":"Projects","menu.skills":"Skills","menu.about":"About Me","menu.contact":"Contact","menu.mangadb":"MangaDB","menu.achievements":"Achievements","menu.all-projects":"All Projects","profile.location":"Vienna, Austria","profile.description":"I'm an {age} year old programmer. I graduated from HTL Donaustadt last year and am passionate about web development.","profile.journey-start.title":"Start of my journey","profile.journey-start.desc":"When I was 15, I discovered my passion for HTML and CSS and created my first website. A few months later, I was faced with the decision of either staying at grammar school after finishing compulsory school or going to a different school. Initially, I wanted to stay at grammar school, but my mother, who recognised my great interest in computers and programming, convinced me to switch to the computer science department at HTL Donaustadt (which was the best decision in hindsight).","profile.htl-donaustadt.title":"HTL Donaustadt","profile.htl-donaustadt.desc":"I then spent 5 years at the HTL Donaustadt and not only learnt numerous new technologies such as C#, Java or NodeJS during my training, but also took part in several competitions such as the Cloudflight Coding Contest or the ATOS HTL Hackathon, where I achieved first place with my team. In the last year, I was able to work on my diploma thesis on the topic of ‘Performant rendering of 3D objects’ and graduated from the HTL with an excellent result.","profile.current.title":"Civilian service","profile.current.desc":"I successfully completed my community service at the end of December 2024.","project.view":"View","project.source":"Source","project.more":"More...","project.description.mandelbrot":"Simple Mandelbrot Explorer in real time.","project.description.picross":"A clone of the popular game 'Picross' in the browser.","project.description.vertex":"A clone of the game 'Vertex Game' (New York Times) in the browser.","project.description.lego":"A tool to build lego models in the browser.","project.description.mangadb":"Fullstack web app to manage your manga collection or keep track of your favorite manga.","project.mangadb.homepage":"Homepage","project.mangadb.settings":"Settings","project.mangadb.series":"Series-Page","project.mangadb.volume":"Volume-Page","project.mangadb.3d-view":"3D-View","project.description.mangadb.full":"MangaDB is my biggest and most ambitious project - a fullstack application that allows manga fans to manage their collections and discover new titles. The frontend is based on Vue.js, while the backend was realized with Node.js and Express. A MySQL database is used for data management, which enables efficient and scalable storage of user data and manga information.","project.description.mangadb.homepage":"The app shows the top 10 most searched series of the last month, the most recently added series and volumes as well as the next releases. All information on series, volumes and co. is loaded in the user's language by default. However, the user can optionally decide to display content such as covers or descriptions from a different edition (e.g. English) if this is available. If the content is neither available in the user's language nor in the other edition, the content is displayed in the language of the series/volume's origin.","project.description.mangadb.series":"The series page of MangaDB offers comprehensive information on each series and its volumes. A series contains descriptions, a list of contributors (e.g. author, illustrator, character designer), the publisher, the title and, of course, an overview of all volumes in various languages. <br><br> The page also shows relationships between series such as spin-offs, sequels and prequels. If available, special editions in the respective language, such as Collectors Editions, are also displayed. The site thus offers a central point of contact for all relevant information on manga series and their releases.","project.description.mangadb.volume":"The MangaDB volume page offers detailed information on each volume. In addition to basic data such as ISBN, publication date, dimensions, language, number of pages, format and age rating, there is a special function: <br><br> The volume can be displayed in 3D if the dimensions and images of the back and spine are available in the system. This function allows users to experience the volume virtually and get a realistic impression of it.","project.description.mangadb.end":"To go into all the features in detail would take too long, so here is a short list of all the functions:","mangadb.features.frontend":"Frontend","mangadb.features.list-management":"List-Management","mangadb.features.collection-management":"Collection-Management","mangadb.features.administration":"Administration","mangadb.features.user-management":"User-Management","mangadb.features.tag-management":"Tag-Management","mangadb.features.series-management":"Series-Management","mangadb.features.volume-management":"Volume-Management","mangadb.features.publisher-management":"Publisher-Management","mangadb.features.contributor-management":"Contributor-Management","mangadb.features.backend":"Backend","mangadb.features.image-compression":"Image-Compression","mangadb.features.caching":"Caching",volumes:n,series:a,publisher:t,contributors:i,"contact.name":"Name","contact.email":"Email","contact.description":"Descriptions","contact.submit":"Submit","achievements.atos":"As part of a 3-day event, my colleagues Leo Müller, Fabian Hohn, Alexander Donner and Patrick Kristen and I were able to develop an idea/prototype on the topic of “sustainability”. Our idea was to optimize salt spreading and we achieved this through a web application with simulated data. We achieved 1st place with this prototype.","achievements.ccc-2021":"At the Cloudflight Coding Contest 2021 I was able to achieve 4th place in the #School Contest and 27th place in the #Classic Contest together with my colleague Leo Müller.","achievements.ccc-2022":"At the Cloudflight Coding Contest 2022, I was able to achieve 3rd place in the #School Contest and 36th place in the #Classic Contest together with my colleague “Martin Schindler”."},s="Sprache",o="Bände",l="Serien",c="Herausgeber",d="Mitwirkende",m={language:s,"language.de":"Deutsch","language.en":"Englisch","language.jpn":"Japanisch","menu.home":"Startseite","menu.stats":"Statistiken","menu.portfolio":"Portfolio","menu.projects":"Projekte","menu.skills":"Fähigkeiten","menu.about":"Über mich","menu.contact":"Kontakt","menu.mangadb":"MangaDB","menu.achievements":"Erfolge","menu.all-projects":"Alle Projekte","profile.location":"Wien, Österreich","profile.description":"Ich bin ein {age} Jahre alter Programmierer. Ich habe letztes Jahr meine Matura an der HTL Donaustadt abgeschlossen und begeistere mich für Web Development.","profile.journey-start.title":"Beginn meiner Reise","profile.journey-start.desc":"Mit 15 entdeckte ich meine Leidenschaft für HTML und CSS und erstellte meine erste eigene Website. Wenige Monate später stand ich vor der Entscheidung, nach Abschluss der Pflichtschule entweder am Gymnasium zu bleiben oder eine andere Schulrichtung einzuschlagen. Anfangs wollte ich am Gymnasium bleiben, doch meine Mutter, die mein großes Interesse an Computern und Programmierung erkannte, überzeugte mich, an die HTL Donaustadt in die Informatikabteilung zu wechseln (Was im nachhinein die beste Entscheidung war).","profile.htl-donaustadt.title":"HTL Donaustadt","profile.htl-donaustadt.desc":"An der HTL Donaustadt verbrachte ich fünf Jahre, in denen ich nicht nur zahlreiche neue Technologien wie C#, Java und NodeJS erlernte, sondern auch an Wettbewerben wie dem Cloudflight Coding Contest und dem ATOS HTL Hackathon teilnahm – letzteren konnte ich mit meinem Team auf dem ersten Platz abschließen. Im letzten Jahr meiner Ausbildung widmete ich mich meiner Diplomarbeit zum Thema „Performantes Rendern von 3D-Objekten“ und schloss die HTL mit ausgezeichnetem Erfolg ab.","profile.current.title":"Zivildienst","profile.current.desc":"Ende Dezember 2024 habe ich meinen Zivildienst erfolgreich abgeschlossen.","project.view":"Öffnen","project.source":"Quellcode","project.more":"Mehr...","project.description.mandelbrot":"Simpler Mandelbrot Explorer in Echtzeit.","project.description.picross":"Ein Klon des populären Spiels 'Picross' im Browser.","project.description.vertex":"Ein Klon des Spiels 'Vertex Game' (New York Times) im Browser.","project.description.lego":"Ein Tool um im Browser Lego zu bauen.","project.description.mangadb":"Fullstack Web-App um seinen Manga-Sammlung zu verwalten oder um die neuesten Bände im Blick zu behalten.","project.mangadb.homepage":"Startseite","project.mangadb.settings":"Einstellungen","project.mangadb.series":"Serien-Seite","project.mangadb.volume":"Band-Seite","project.mangadb.3d-view":"3D-Ansicht","project.description.mangadb.full":"MangaDB ist mein größtes und ambitioniertestes Projekt – eine Fullstack-Anwendung, die es Manga-Fans ermöglicht, ihre Sammlungen zu verwalten und neue Titel zu entdecken. Das Frontend basiert auf Vue.js, während das Backend mit Node.js und Express realisiert wurde. Für die Datenverwaltung kommt eine MySQL-Datenbank zum Einsatz, die eine effiziente und skalierbare Speicherung von Nutzerdaten und Manga-Informationen ermöglicht.","project.description.mangadb.homepage":"Die App zeigt die Top 10 der meistgesuchten Serien des letzten Monats, die zuletzt hinzugefügten Serien und Bände sowie die nächsten Veröffentlichungen. Alle Informationen zu Serien, Bänden und Co. werden standardmäßig in der Sprache des Nutzers geladen. Optional kann der Nutzer jedoch entscheiden, Inhalte wie Cover oder Beschreibungen aus einer anderen Ausgabe (z. B. der englischen) anzuzeigen, sofern diese verfügbar ist. Wenn die Inhalte weder in der Sprache des Nutzers noch in der anderen Ausgabe verfügbar sind, werden die Inhalte in der Sprache des Ursprungs der Serie/Band angezeigt.","project.description.mangadb.series":"Die Serien-Seite von MangaDB bietet umfassende Informationen zu jeder Serie und ihren Bänden. Eine Serie enthält Beschreibungen, eine Liste der Mitwirkenden (z. B. Autor, Zeichner, Character Designer), den Herausgeber, den Titel und natürlich eine Übersicht aller Bände in verschiedenen Sprachen. <br><br> Zusätzlich zeigt die Seite Beziehungen zwischen Serien wie Spin-Offs, Sequels und Prequels. Falls vorhanden, werden auch Sonderausgaben in der jeweiligen Sprache, wie Collectors Editions, angezeigt. Die Seite bietet damit eine zentrale Anlaufstelle für alle relevanten Informationen zu Manga-Serien und ihren Veröffentlichungen.","project.description.mangadb.volume":"Die Band-Seite von MangaDB bietet detaillierte Informationen zu jedem Manga-Band. Neben grundlegenden Daten wie ISBN, Veröffentlichungsdatum, Abmessungen, Sprache, Seitenanzahl, Format und Altersfreigabe gibt es eine besondere Funktion: <br><br> Der Band kann in 3D angezeigt werden, sofern die Abmessungen sowie die Bilder der Rückseite und des Buchrückens im System verfügbar sind. Diese Funktion ermöglicht es Nutzern, den Band virtuell zu erleben und sich einen realistischen Eindruck davon zu verschaffen.","project.description.mangadb.end":"Auf alle Features im Detail einzugehen, würde zu lange dauern deshalb hier eine kleine Aufzählung an allen Funktionen:","mangadb.features.frontend":"Frontend","mangadb.features.list-management":"Listen-Verwaltung","mangadb.features.collection-management":"Sammlungs-Verwaltung","mangadb.features.administration":"Administration","mangadb.features.user-management":"Benutzer-Verwaltung","mangadb.features.tag-management":"Tag-Verwaltung","mangadb.features.series-management":"Serien-Verwaltung","mangadb.features.volume-management":"Band-Verwaltung","mangadb.features.publisher-management":"Herausgeber-Verwaltung","mangadb.features.contributor-management":"Mitwirkende-Verwaltung","mangadb.features.backend":"Backend","mangadb.features.image-compression":"Bild-Komprimierung","mangadb.features.caching":"Caching",volumes:o,series:l,publisher:c,contributors:d,"contact.name":"Name","contact.email":"Email","contact.description":"Beschreibung","contact.submit":"Abschicken","achievements.atos":"Im Rahmen eines 3-tägigen Events konnte ich zusammen mit meinen Kollegen Leo Müller, Fabian Hohn, Alexander Donner, Patrick Kristen eine Idee / einen Prototypen zum Thema “Nachhaltigkeit” entwickeln. Unsere Idee war die Salzstreuung zu optimieren und dies haben wir durch eine Web Applikation mit simulierten Daten erreicht. Mit diesem Prototypen haben wir den 1. Platz erreicht.","achievements.ccc-2021":"Beim Cloudflight Coding Contest 2021 konnte ich zusammen mit meinem Kollegen Leo Müller den 4. Platz im #School Contest und den 27. Platz im #Classic Contest erreichen.","achievements.ccc-2022":"Beim Cloudflight Coding Contest 2022 konnte ich zusammen mit meinem Kollegen Martin Schindler den 3. Platz im #School Contest und den 36. Platz im #Classic Contest erreichen."},u="言語",g="巻数",h="シリーズ",p="出版社",b="投稿者",f={language:u,"language.de":"ドイツ語","language.en":"英語","language.jpn":"日本語","menu.home":"ホームページ","menu.stats":"統計","menu.portfolio":"ポートフォリオ","menu.projects":"プロジェクト","menu.skills":"スキル","menu.about":"私のこと","menu.contact":"お問い合わせ","menu.mangadb":"マンガDB","menu.achievements":"実績","menu.all-projects":"すべてのプロジェクト","profile.location":"オーストリア、ウィーン","profile.description":"歳のプログラマーです。昨年HTL Donaustadtを卒業し、ウェブ開発に情熱を注いでいます。","profile.journey-start.title":"旅の始まり","profile.journey-start.desc":"15歳のとき、HTMLとCSSへの情熱を見出し、初めてウェブサイトを作った。数ヵ月後、義務教育を終えて文法学校に残るか、別の学校に行くかの決断を迫られた。当初、私は文法学校に残りたかったのですが、私のコンピューターとプログラミングへの大きな興味を認めてくれた母が、HTLドナウシュタットのコンピューターサイエンス科に転校するよう説得してくれました（今にして思えば、これが最良の決断でした）。","profile.htl-donaustadt.title":"HTL Donaustadt","profile.htl-donaustadt.desc":"その後、HTL Donaustadtで5年間を過ごし、トレーニング中にC#、Java、NodeJSなど数多くの新しい技術を学んだだけでなく、Cloudflight Coding ContestやATOS HTL Hackathonなどいくつかのコンペティションに参加し、自分のチームで優勝することができました。昨年は、「3Dオブジェクトの高性能レンダリング」というテーマで卒業論文に取り組み、優秀な成績でHTLを卒業することができました。","profile.current.title":"市民サービス","profile.current.desc":"2024年12月末に社会奉仕活動を無事に終えました。","project.view":"オープン","project.source":"ソースコード","project.more":"もっと...","project.description.mandelbrot":"シンプルなマンデルブロ・エクスプローラーをリアルタイムで表示。","project.description.picross":"人気ゲーム「ピクロス」のブラウザ版。","project.description.vertex":"バーテックス・ゲーム」（ニューヨーク・タイムズ）のクローンをブラウザで。","project.description.lego":"ブラウザでレゴを作るツール。","project.description.mangadb":"マンガのコレクションを管理したり、最新巻を把握するためのフルスタックのウェブアプリ。","project.mangadb.homepage":"ホームページ","project.mangadb.settings":"設定","project.mangadb.series":"シリーズ-ページ","project.mangadb.volume":"巻-ページ","project.mangadb.3d-view":"3Dビュー","project.description.mangadb.full":"MangaDBは、私の最大かつ最も野心的なプロジェクトで、漫画ファンが自分のコレクションを管理し、新しいタイトルを発見できるフルスタック・アプリケーションです。フロントエンドはVue.jsベースで、バックエンドはNode.jsとExpressで実現した。データ管理にはMySQLデータベースを使用しており、ユーザーデータやマンガ情報を効率的かつスケーラブルに保存することができます。","project.description.mangadb.homepage":"このアプリは、先月最も検索されたシリーズトップ10、最近追加されたシリーズと巻数、次回リリースを表示します。シリーズ、巻、およびその他の情報はすべて、デフォルトでユーザーの言語で読み込まれます。ただし、表紙や解説などのコンテンツが別の言語（英語など）で表示可能な場合は、ユーザーが任意で表示させることができます。コンテンツがユーザーの言語でも他の版でも利用できない場合、コンテンツはシリーズ/巻の原版の言語で表示されます。","project.description.mangadb.series":"MangaDBのシリーズページでは、各シリーズとその巻に関する包括的な情報を提供しています。シリーズには、説明、貢献者リスト（例：作者、イラストレーター、キャラクターデザイナー）、出版社、タイトル、そしてもちろん、様々な言語での全巻の概要が含まれています。 <br><br> また、スピンオフ、続編、前日譚といったシリーズ間の関係も表示される。もしあれば、コレクターズ・エディションなど、それぞれの言語の特別版も表示されます。このように、このサイトは、マンガのシリーズとそのリリースに関するすべての関連情報の中心的な連絡先を提供しています。","project.description.mangadb.volume":"MangaDBの各巻ページでは、各巻の詳細情報を提供しています。ISBN、出版日、寸法、言語、ページ数、フォーマット、年齢レーティングなどの基本データに加えて、特別な機能があります： <br><br> 背中と背骨の寸法と画像がシステムにあれば、体積を3Dで表示することができる。この機能により、ユーザーはボリュームをバーチャルに体験し、リアルな印象を得ることができる。","project.description.mangadb.end":"すべての機能を詳しく説明すると長くなるので、ここではすべての機能の簡単なリストを紹介する：","mangadb.features.frontend":"フロントエンド","mangadb.features.list-management":"リスト管理","mangadb.features.collection-management":"コレクション管理","mangadb.features.administration":"管理部門","mangadb.features.user-management":"ユーザー管理","mangadb.features.tag-management":"タグ管理","mangadb.features.series-management":"シリーズ・マネジメント","mangadb.features.volume-management":"ボリューム管理","mangadb.features.publisher-management":"出版社-マネジメント","mangadb.features.contributor-management":"貢献者-マネジメント","mangadb.features.backend":"バックエンド","mangadb.features.image-compression":"画像圧縮","mangadb.features.caching":"キャッシング",volumes:g,series:h,publisher:p,contributors:b,"contact.name":"名称","contact.email":"電子メール","contact.description":"内容","contact.submit":"投稿する","achievements.atos":" 3日間のイベントの一環として、同僚のレオ・ミュラー、ファビアン・ホーン、アレクサンダー・ドナー、パトリック・クリステンと私は、「持続可能性」というテーマでアイデア／プロトタイプを開発することができた。私たちのアイデアは塩の散布を最適化することで、シミュレーション・データを使ったウェブ・アプリケーションでこれを実現しました。私たちはこのプロトタイプで1位を獲得しました。","achievements.ccc-2021":"Cloudflight Coding Contest 2021では、同僚のLeo Müllerと共に#スクールコンテストで4位、#クラシックコンテストで27位を獲得することができました。","achievements.ccc-2022":"Cloudflight Coding Contest 2022では、同僚のMartin Schindlerと共に、#スクールコンテストで3位、#クラシックコンテストで36位に入賞することができました。"},v={en:r,de:m,jpn:f},w=Object.assign(v),j=async()=>({legacy:!1,messages:w,locale:"en"});export{j as default};
